(2213, 'SOF0293.14', 'Data surat izin non full day dari ESS tidak dapat dikonfirmasi, karyawan sudah berhenti kerja pada tanggal cuti yang diajukan', 'Data permit non full day of ESS can not be confirmed, the employees had stopped work on the proposed furlough', 'Die Daten erlauben nicht vollen Tag der ESS nicht bestätigt werden kann, hatten die Mitarbeiter die Arbeit an der vorgeschlagenen furlough gestoppt', '数据证ESS的非全日无法确认，该员工已经停止了对提议休假工作', 'データは、ESSの非完全な日が確認できない、従業員が提案した休暇に作業を停止していた許可します', '데이터 허가 ESS의 비 하루 종일이 확인 될 수 없다는 직원 제안 말미에 작업을 중단했다', 'Разрешение данных, не полный рабочий день ESS не может быть подтвержден, сотрудники прекратили работу по предложенному отпуску', NULL),
(2214, 'SOF0293.15', 'Data surat izin non full day dari ESS tidak dapat dibatal konfirmasi, karyawan sudah berhenti kerja pada tanggal cuti yang diajukan', 'Data permit non full day of ESS can not dibatal confirmation, employees had stopped work on the proposed furlough', 'Die Daten erlauben nicht vollen Tag der ESS kann nicht dibatal Bestätigung, hatten Mitarbeiter Arbeit an der vorgeschlagenen furlough gestoppt', 'ESS的数据允许非全日不能dibatal确认，员工已经停止了对所提出的休假工作', 'データは、ESSの非完全な日がdibatal確認、従業員が提案した休暇に作業を停止していたことができません許可します', 'ESS의 데이터 허가 비 하루 종일 dibatal하지 확인, 직원 제안 말미에 작업을 중단 한 수', 'Разрешение данных, не полный рабочий день ESS не может dibatal подтверждения, сотрудники прекратили работу по предложенному отпуску', NULL),
(2215, 'SOF0293.16', 'Data surat izin non full day dari ESS tidak dapat disimpan, tanggal awal cuti tidak boleh lebih kecil dari tanggal awal masuk kerja', 'Data permit non full day of ESS can not be stored, leave the starting date can not be smaller than the start date for work', 'Die Daten erlauben nicht voller Tag der ESS kann nicht gespeichert werden, lassen Sie das Startdatum kann nicht kleiner sein als das Startdatum für die Arbeit', '数据允许ESS的非全日不能储存，离开开始日期不能比的开始日期的工作更小', 'データは、ESSの非完全な日は保存することができない可能にし、作業の開始日よりも小さくすることはできません開始日を残します', '데이터는 ESS의 비 하루 종일이 저장되지 않을 수 있도록, 작업의 시작 날짜보다 작을 수 없습니다 시작 날짜를 남겨', 'данные позволяют не полный рабочий день ESS не может быть сохранен, оставить начальную дату не может быть меньше даты начала работы', NULL),
(2216, 'SOF0293.17', 'Pada tanggal tersebut karyawan sudah di proses absensi hariannya', 'On that date the employee is already in the process of daily absences', 'Zu diesem Zeitpunkt ist der Mitarbeiter bereits im Prozess der täglichen Abwesenheiten', '在当日的员工已经在日常缺勤的过程', 'その日に従業員が日々の欠勤の過程ですでにあります', '해당 날짜에 직원이 매일 결석하는 과정에서 이미', 'В этот день работник уже в процессе ежедневных отлучек', NULL),
(2217, 'SOF0293.18', 'Data surat izin non full day dari ESS berhasil disetujui', 'Data permit non full day of ESS successfully approved', 'Die Daten erlauben nicht vollen Tag der ESS erfolgreich genehmigt', 'ESS的数据允许非全日成功获批', 'データは、ESSの非丸一日が正常に承認された許可します', 'ESS의 데이터 허가 비 하루 종일 성공적으로 승인', 'Разрешение данных, не полный рабочий день ESS успешно апробирован', NULL),
(2218, 'SOF0293.19', 'Data surat izin non full day dari ESS berhasil ditolak', 'Data permit non full day of ESS successfully rejected', 'Die Daten erlauben nicht vollen Tag der ESS erfolgreich abgelehnt', 'ESS的数据允许非全日成功拒绝', 'データは、ESSの非丸一日が正常に拒否許可します', 'ESS의 데이터 허가 비 하루 종일이 성공적으로 거부', 'Разрешение данных, не полный рабочий день ESS успешно отклонен', NULL),
(2219, 'SOF0293.20', 'Jam awal tidak kosong untuk surat izin non full day', 'Early hours is not empty for non-full-day license', 'Frühe Morgenstunden sind nicht leer für Nicht-Ganztag Lizenz', '早睡早起是不是空的非全日制许可证', '早い時間は、非全日ライセンスの空ではありません', '이른 시간이 아닌 하루 종일 라이센스 비어 있지', 'Первые часы не пусты для получения лицензии, не полного дня', NULL),
(2220, 'SOF0293.21', 'Jam akhir tidak kosong untuk surat izin non full day', 'Final hour is not empty for non-full-day license', 'Letzte Stunde nicht leer ist für Nicht-Ganztages Lizenz', '最后一个小时是不是空的非全日制许可证', '最終的な時間は、非全日ライセンスの空ではありません', '최종 시간이 아닌 하루 종일 라이센스 비어 있지', 'Заключительный час не пуст для получения лицензии, не полного дня', NULL),
(2221, 'SOF0293.22', 'Tanggal izin awal harus sama dengan tanggal izin akhir pada surat izin non full day', 'Date of initial license must be the same as the date of the end of the license permit non full day', 'Datum der ersten Lizenz muss das gleiche sein wie das Datum des Endes des genehmigungs nicht ganztags', '初始许可的日期必须是一样的牌照，准许非全日结束的日期', '最初のライセンスの日付は、ライセンス許可証不完全な一日の終わりの日と同じでなければなりません', '초기 라이센스 날짜는 라이센스 허가가 아닌 하루의 끝의 날짜와 동일해야합니다', 'Дата первой лицензии должна быть такой же, как на дату окончания срока действия разрешения лицензии, не полный рабочий день', NULL),
(2222, 'SOF0293.23', 'Hanya data surat izin non full day yang masih pending yang bisa dihapus', 'Only data non full day license pending erasable', 'Nur die Daten nicht Lizenz ganzen Tag anstehenden löschbar', '只有数据非全日授权挂起擦除', 'データのみ非フル日間ライセンス消去可能保留', '데이터 만이 아닌 하루 종일 라이센스 지울 출원', 'Только данные не полный день лицензии в ожидании стираемые', NULL),
(2223, 'SOF0293.24', 'Hanya data surat izin non full day yang masih pending oleh atasan yang bisa dihapus', 'Only data non full-day license is still pending by the employer which may be removed', 'Nur die Daten nicht Lizenz ganztägige noch vom Arbeitgeber anhängig, die entfernt werden können,', '只有数据非整天许可证仍然可以去除用人单位待定', 'データのみ非全日ライセンスはまだ除去してもよい雇用者が保留されています', '데이터 만이 아닌 전체 일 라이센스는 여전히 제거 될 수 고용주에 의해 보류', 'Только данные не лицензия на целый день все еще ожидает от работодателя, который может быть удален', NULL),
(2224, 'SOF0293.25', 'Tanggal harus diisi', 'Date required', 'Datum erforderlich', '需要日期', '日付必要', '날짜가 필요합니다', 'Дата требуется', NULL),
