(2235, 'SOF0298.13', 'Pada tanggal tersebut karyawan sudah di proses absensi hariannya', 'On that date the employee is already in the process of daily absences', 'Zu diesem Zeitpunkt ist der Mitarbeiter bereits im Prozess der täglichen Abwesenheiten', '在当日的员工已经在日常缺勤的过程', 'その日に従業員が日々の欠勤の過程ですでにあります', '해당 날짜에 직원이 매일 결석하는 과정에서 이미', 'В этот день работник уже в процессе ежедневных отлучек', NULL),
(2236, 'SOF0298.14', 'Surat cuti setengah hari tidak dapat disimpan, cuti yang diajukan merupakan hari libur', 'Letter leave half a day can not be stored, leave filed a holiday', 'Brief hinterlassen einen halben Tag kann nicht gespeichert werden, lassen einen Urlaub eingereicht', '信离开半天不能保存，请提交放假', '半日の休暇を提出したままにし、保存することができないまま手紙', '편지는 반나절이 저장 될 수 없습니다 떠나 휴가를 신청 둡니다', 'Письмо оставить половину дня не могут быть сохранены, оставить подал праздник', NULL),
(2237, 'SOF0298.15', 'Surat cuti setengah hari tidak dapat disimpan, tanggal awal cuti tidak boleh lebih kecil dari tanggal awal masuk kerja', 'Letter leave half a day can not be stored, leave the starting date can not be smaller than the start date for work', 'Brief hinterlassen einen halben Tag kann nicht gespeichert werden, lassen Sie das Startdatum kann nicht kleiner als der Starttermin für die Arbeit', '信离开半天不能储存，离开起始日期不能比的开始日期的工作更小', '手紙には、作業の開始日よりも小さくすることはできません開始日を残して、半日は保存することができないまま', '편지는 작업의 시작 날짜보다 작은 수 없습니다 시작 날짜를 떠나, 반나절은 저장할 수 없습니다 떠나', 'Letter оставить половину дня не может быть сохранен, оставить начальную дату не может быть меньше даты начала работы', NULL),
