(2239, 'SOF0298.17', 'Surat cuti setengah hari tidak dapat dibatal konfirmasi, karyawan sudah berhenti kerja pada tanggal cuti yang diajukan', 'Letters can not leave half day dibatal confirmation, employees had stopped work on the proposed furlough', 'Briefe können einen halben Tag dibatal Bestätigung nicht verlassen hatten Mitarbeiter Arbeit an der vorgeschlagenen furlough gestoppt', '快报不能离开半天dibatal确认，员工已经停止了对所提出的休假工作', '半日dibatal確認を離れることができない文字は、従業員が提案されている休暇に作業を停止していました', '반나절 dibatal 확인을 떠날 수없는 편지는, 직원 제안 말미에 작업을 중단했다', 'Письма не могут оставлять половину дня подтверждения dibatal, сотрудники прекратили работу по предложенному отпуску', NULL),
(2240, 'SOF0298.18', 'Surat cuti setengah hari tidak dapat disimpan, tanggal yang diajukan ada sudah digunakan pada cuti massal', 'Letter leave half a day can not be saved, the proposed date there are already used on mass leave', 'Brief hinterlassen einen halben Tag kann nicht gespeichert werden, die vorgeschlagenen Zeitpunkt gibt es bereits auf Massenurlaub verwendet', '信离开半天不能保存，建议日期目前已经用在质量休假', '手紙は半日を保存することができないまま、提案された日付はすでにマス休暇に使用されているが', '편지 반나절을 저장할 수 없습니다 떠나, 제안 된 날짜는 이미 대량 휴가 사용이', 'Письмо оставить половину дня не может быть сохранен, предлагаемая дата там уже используется в массовом отпуске', NULL),
(2241, 'SOF0298.19', 'Parameter jatah cuti untuk tahun {0} tidak ada, silakan mengisi parameter jatah cuti terlebih dahulu', 'Parameter vacation time for the year {0} does not exist, please fill in the parameters vacation time in advance', 'Parameter Urlaubszeit für das Jahr {0} nicht vorhanden ist, füllen Sie bitte die Parameter Urlaubszeit im Voraus', '参数休假时间为今年{0}不存在，请填写参数休假时间提前', '{0}年のパラメータ休暇の時間は事前にパラメータの休暇時間を記入してください、存在しません。', '{0} 연도의 매개 변수 휴가 시간은 사전에 매개 변수 휴가 시간에 작성하여, 존재하지 않는', 'Параметр отпуска для {0} года не существует, пожалуйста, заполните время параметров отпусков заранее', NULL),
