(2315, 'SOF0330.15', 'Data surat tugas non full day dari ESS tidak dapat dibatal konfirmasi, karyawan sudah berhenti kerja pada tanggal tugas yang diajukan', 'Data assignment letter from the non full day dibatal ESS can not confirm, employees had stopped work on the proposed task', 'Datenzuordnung Brief aus dem nicht voll Tag dibatal ESS kann nicht bestätigen, hatten Mitarbeiter Arbeit an der vorgeschlagenen Aufgabe gestoppt', '从非全日dibatal ESS数据分配盘符无法证实，员工已经停止了对所提出的工作任务', '非終日dibatalのESSからのデータの割り当て文字が確認できない、従業員は、提案されたタスクの作業を停止していました', '확인할 수없는 비 하루 종일 dibatal의 ESS의 데이터 할당 편지, 직원 제안 된 작업에 대한 작업을 중단했다', 'Назначение данных письмо от не полного дня dibatal ESS не может подтвердить, сотрудники прекратили работу по предложенной задаче', NULL),
(2316, 'SOF0330.16', 'Data surat tugas non full day dari ESS tidak dapat disimpan, tanggal awal tugas tidak boleh lebih kecil dari tanggal awal masuk kerja', 'Data non full day assignment letter from ESS can not be stored, the earliest date a task can not be smaller than the start date for work', 'Daten nicht Tag Zuordnung Brief von ESS kann nicht gespeichert werden, das früheste Datum eine Aufgabe, die nicht kleiner als das Startdatum für die Arbeit sein kann', '从ESS数据非全日委派信不能存储，任务不能比的开始日期的工作更小的最早日期', 'ESSからのデータ以外終日割り当て手紙は、タスクは作業の開始日よりも小さくすることができない最も早い日付を格納することはできません', 'ESS의 데이터가 아닌 하루 종일 할당 편지, 작업이 작업의 시작 날짜보다 작을 수 없습니다 가장 빠른 날짜를 저장할 수 없습니다', 'Данные не письмо присваивания полного рабочего дня от ESS не может быть сохранена, самой ранней дата, задача не может быть меньше даты начала работы', NULL),
