(2455, 'SOF0309.15', 'Data surat cuti spesial dari ESS tidak dapat dibatal konfirmasi, karyawan sudah berhenti kerja pada tanggal cuti yang diajukan', 'Data letter from the special leave dibatal ESS can not confirm, employees had stopped work on the proposed furlough', 'Daten Schreiben des Sonderurlaub dibatal ESS kann nicht bestätigen, hatten Mitarbeiter Arbeit an der vorgeschlagenen furlough gestoppt', '从特别许可dibatal ESS无法确认数据信的员工已经停止了对所提出的休假工作', 'ESSが確認できない特別休暇dibatalからのデータの手紙は、従業員が提案されている休暇に作業を停止していました', 'ESS는 확인할 수없는 특별한 휴가 dibatal의 데이터 문자는, 직원 제안 말미에 작업을 중단했다', 'письмо Данных из специального отпуска dibatal ESS не может подтвердить, сотрудники прекратили работу по предложенному отпуску', NULL),
