(3139, 'ABOUT_US', 'Gaji adalah sebuah aplikasi Payroll Online atau pengolahan penggajian online yang dirancang khusus untuk memduahkan para pengguna dalam perhitungan gaji khusus-nya di Indonesia', 'Salary is an online Payroll application or online payroll processing specifically designed to empower users in calculating their specific salary in Indonesia.', 'Salary ist eine Online-Gehaltsabrechnungsanwendung oder eine Online-Gehaltsabrechnungsverarbeitung, die speziell entwickelt wurde, um Benutzern die Möglichkeit zu geben, ihr spezifisches Gehalt in Indonesien zu berechnen.', '薪金是一种在线薪资应用程序或在线薪资处理程序，旨在使用户能够计算自己在印度尼西亚的特定薪水。', '給与は、ユーザーがインドネシアで特定の給与を計算できるように特別に設計されたオンライン給与計算アプリケーションまたはオンライン給与処理です。', '급여는 사용자가 인도네시아에서 특정 급여를 계산할 수 있도록 특별히 설계된 온라인 급여 응용 프로그램 또는 온라인 급여 처리입니다.', 'Зарплата - это онлайн-приложение для расчета заработной платы или онлайн-система расчета заработной платы, специально разработанная для предоставления пользователям возможности расчета их конкретной заработной платы в Индонезии.', NULL),
